import QRCode from "./components/QRCode";
function App() {
  return (
    <div className="App">
      <img
        style={{ width: 200, height: 200 }}
        alt=""
        src="../images/image.png"
      />

      <h1>111111111111</h1>
      <QRCode />
    </div>
  );
}

export default App;
